import React from "react";
import "./Sidebar.css";

export default function Sidebar() {
  return(
  <div className="sidebar">
      <ul>
        <li>Create NFT</li>
        <li>Collectibles</li>
        <li>Manage SLA</li>
        <li>Event Logs</li>
        <li>BC Transaction</li>
      </ul>
  </div>
  );
}
